import Nav from "./Nav";
import React from 'react';
import Image from './resources/heart.png'


class Bar extends React.Component{
    render() {
        return (
            <div>
            <image src={Image} alt="profile"/>
              <Nav isLoggedIn={false} />

            </div>
        )};
}

export default Bar;
